import axios from "axios";
import { useEffect, useState } from "react"

function App() {
  const [users, setUsers] = useState([]);

  const fetchData = () => {
    return axios
      .get("https://jsonplaceholder.typicode.com/posts")
      .then((responce) => setUsers(responce.data))

  }

  useEffect(() => {
    fetchData()
  }, []);

  console.log(users);
  return (
    <>
      <div className="input-container"></div>
      <input className="userId d-flex align-items-center justify-content-center " type="number"></input>
      {users.map((data) => {
        return (
          <div className="row-5">
            <div className="col-sm-3">
              <div className=" card col-sm-6 container-fluid d-flex flex-wrap " style={{ width: "400px", }}>
                <div className="card-body">
                  <h5 className="card-title">{data.id} . {data.title}</h5>
                  <h6 class="card-subtitle mb-2 text-muted">userId:{data.userId}</h6>
                  <p className="card-text">{data.body}</p>
                </div>
              </div>
            </div>
          </div>

        )
      })}
    </>
  );
}

export default App;
